import React from 'react';
import logo from './logo.svg';
import './App.css';

fetch('https//jsonplaceholder.typicode.com.todos/1')
  .then((response) => {
    return response.json()
  })
  .then((result) => {
    console.log(result)
  })

function App() {
  return (
    <div className="App">
      <h1>Hello test</h1>
    </div>
  );
}

export default App;
